import React from 'react';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<div>login</div>} />
        <Route path="/entities" element={<div>entities</div>} />
        <Route path="/list/:type" element={<div>entities</div>} />
        <Route path="/view/:id" element={<div>entities</div>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
